  false,\n\t\"url\": null,\n\t\"notes\": \"This plan will provide a strategy for furnishing
  assistance to any agency when a wildfire situation demands more resources than the
  agency has available. The wildfire management objectives include; assist personnel
  in various agencies in maintaining awareness of soil moisture conditions, provide
  for cooperation and uniformity in planning and implementing prevention actions,
  provide a common channel for providing and requesting assistance within the Northeastern
  U.S. and from BIFC when necessary, and provide a mechanism for screening orders
  in a multi-fire situation.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
